import { Visibility } from "@material-ui/icons";
import axios from 'axios';
import authHeader from '../../services/authHeader';
import { useEffect,useState } from "react";

export default function WidgetSm() {
  const config = {
    headers: authHeader() 
  };

  const[values,setValues]=useState([]);

const loadUser = async () => {
  const result = await axios.get(`http://localhost:9000/api/getallride`,config);
  setValues(result.data);
  console.log(result.data)

};
useEffect(() => {
 console.log("User-useeffect");
  loadUser();


}, []);
  return (
    <div className="widgetSm">
      <span className="widgetSmTitle">Ride Historyyy</span>
     <div>

                        {values.map((x) => {
                return <tr className="widgetLgTr">


                <div className="widgetLgList">{x.passenger.firstname+" "}{x.passenger.lastname}</div>

                <div className="widgetLgListItems">{x.date}</div>
                <span className="widgetLgName">{x.passenger.source}</span>
                <span className="widgetLgName">{x.passenger.destination}</span>



              </tr>
              })}

      </div>


      </div>

  );
}
